  def parseToSelect(versionTable: ArrayBuffer[String]): ArrayBuffer[String] = {
    //ParameterSql.initSql("G:\\Users\\lkz\\IdeaProjects\\ftptohdfs_v3\\src\\main\\scala\\ftptohdfs_v1\\parametersql.properties")
    val wideFields = ParameterSql.getWide_fields()
    //println("wideFields:"+wideFields)
    val wideFieldsSplits = wideFields.split(",")
    //println("wideFieldsSplits:"+wideFieldsSplits.size)
    var wideFieldArr = Array[String]()
    wideFieldArr = wideFieldsSplits.toArray
    var arrayVersion = ArrayBuffer[Array[String]]()
    //println(wideFieldArr.indexOf("suc_in_prep_interfreq_x2"))
    val versionTablesFields = generateSelect(versionTable)
    //println("versionTablesFields:"+versionTablesFields)
    val versionTables = versionTablesFields.map(versionTable => {
      // println("version table:"+versionTable)
      //versionTable代表五个表
      var versionFiveTable = new ArrayBuffer[String]()
      wideFieldArr.foreach(wideArr => {
        versionFiveTable += "'' " + wideArr
      })
      val wideIntersect = wideFieldArr.intersect(versionTable)
      wideIntersect.map(insters => {
        // println("insters:"+insters)
        val index = wideFieldArr.indexOf(insters)
        versionFiveTable.update(index, insters)
      })
      var fieldCon = new StringBuffer()
      var i = 0
      for (wide <- versionFiveTable) {
        if (i != versionFiveTable.size - 1) {
          fieldCon = fieldCon.append(wide + ",")
        } else {
          fieldCon = fieldCon.append(wide)
        }

        i += 1
      }
      //println(fieldCon.toString)
      fieldCon.toString
      // println(versionFiveTable)
      //println("versionFiveTable: "+versionFiveTable)
      //print(versionFiveTable.size)
    })
    versionTables
  }


  def generateSelect(versionTable: ArrayBuffer[String]): ArrayBuffer[Buffer[String]] = {
    val versionFields = versionTable.map(createStr => {
      generateSelectTable(createStr)
    })
    //print(versionFields)
    versionFields
  }


  val generateSelectTable = (createTable: String) => {
    val strSplit = createTable.split("\\(")
    val strSplit1 = strSplit(1).split("\\)")
    val strSplit2 = strSplit1(0).split(",")
    val field = strSplit2.map(fieldtype => {
      val fileldtypes = fieldtype.split(" ")
      fileldtypes(0)
    })
    //field.foreach(x => print(x + ","))
    field.toBuffer
  }

